AvgPriceSizeByMinute._queryString:
{[symval]
  {select from x where minute<=.z.p}fxrack lj update cum:sums vol from select size wavg price,vol:sum size by minute:0D00:01 xbar time from dfxTrade where sym=symval
  }

getQuote._queryString:
{x lj select qty:{value sum each y@group 0D01 xbar x}[time;size]by sym from dfxTrade where time<.z.p}
  update spread%n,oneM:spread%n,fiveM:(.01*count[i]?100)+spread%n,tenM:(1+.01*count[i]?100)+spread%n,twentyM:(2+.01*count[i]?100)+spread%n,n:1+10 xlog 1%n from
    update n:?[sym like"*JPY";0.01;0.0001],spread:ask-bid from(select by sym from dfxQuote where time<.z.p)lj
      //60 point limit for sparklines 1D=0D00:24*60
      select mid:x by sym from select last .5*bid+ask by sym,0D00:24 xbar time from dfxQuote where time<.z.p
